import React from "react";
import "./Navbar.css";
export default function Navbar() {
  return (
    <div>
    <nav>
    <ul class="nav__links">
        <li><a href="#">Services</a></li>
        <li><a href="#">Projects</a></li>
        <li><a href="#">About</a></li>
    </ul>
</nav>
<div class="overlay">
            <a class="close">&times;</a>
            <div class="overlay__content">
                <a href="#">Services</a>
                <a href="#">Projects</a>
                <a href="#">About</a>
            </div>
        </div>
        </div>
  );
}
